      "content": "pragma solidity ^0.8.0;\n\ninterface IswETH {\n    function swETHToETHRate() external view returns (uint256);\n}\n\ncontract swETHRateProvider {\n    address public immutable swETH = 0xf951E335afb289353dc249e82926178EaC7DEd78;\n    uint256 public immutable startingRate;\n    uint256 public immutable ksETHPerToken;\n    uint256 public immutable tokenPerksETH;\n\n    constructor() {\n        startingRate = _underlyingRate();\n        ksETHPerToken = startingRate;\n        tokenPerksETH = 1e18 * 1e18 / startingRate;\n    }\n\n    function accrualRate() public view returns (uint256) {\n        return 1e18 * _underlyingRate() / startingRate;\n    }\n\n    function _underlyingRate() internal view returns (uint256) {\n        return IswETH(swETH).swETHToETHRate();\n    }\n}\n"
